\u0441\u0438\u0438 \u0432\u044b\u0448\u0435\u043b \u0443\u043a\u0430\u0437 \u043e\u0431 \u0443\u0440\u0430\u0432\u043d\u0435\u043d\u0438\u0438 \u043a\u0440\u0435\u0441\u0442\u044c\u044f\u043d \u0432 \u043f\u0440\u0430\u0432\u0430\u0445 \u0441 \u0434\u0440\u0443\u0433\u0438\u043c\u0438 \u0441\u043e\u0441\u043b\u043e\u0432\u0438\u044f\u043c\u0438 \u0432 \u043e\u0442\u043d\u043e\u0448\u0435\u043d\u0438\u0438 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0441\u043b\u0443\u0436\u0431\u044b, \u0441\u0432\u043e\u0431\u043e\u0434\u044b \u0432\u044b\u0431\u043e\u0440\u0430 \u043f\u043e\u0441\u0442\u043e\u044f\u043d\u043d\u043e\u0433\u043e \u043c\u0435\u0441\u0442\u0430 \u0436\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430, \u043e\u0431 \u043e\u0442\u043c\u0435\u043d\u0435 \u0442\u0435\u043b\u0435\u0441\u043d\u044b\u0445 \u043d\u0430\u043a\u0430\u0437\u0430\u043d\u0438\u0439 \u043f\u043e \u043f\u0440\u0438\u0433\u043e\u0432\u043e\u0440\u0443 \u0432\u043e\u043b\u043e\u0441\u0442\u043d\u044b\u0445 \u0441\u0443\u0434\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1914_%D0%B3%D0%BE%D0%B4\" title=\"1914 \u0433\u043e\u0434\">1914<\/a>&#160;\u2014 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%B4%D0%B2%D0%BE%D0%B4%D0%BD%D0%B0%D1%8F_%D0%BB%D0%BE%D0%B4%D0%BA%D0%B0\" title=\"\u041f\u043e\u0434\u0432\u043e\u0434\u043d\u0430\u044f \u043b\u043e\u0434\u043a\u0430\">\u043f\u043e\u0434\u0432\u043e\u0434\u043d\u0430\u044f \u043b\u043e\u0434\u043a\u0430<\/a> \u0432 \u0431\u043e\u044e \u0431\u044b\u043b\u0430 \u043f\u043e\u0442\u043e\u043f\u043b\u0435\u043d\u0430 \u0434\u0440\u0443\u0433\u043e\u0439 \u043f\u043e\u0434\u0432\u043e\u0434\u043d\u043e\u0439 \u043b\u043e\u0434\u043a\u043e\u0439. \u0412 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D0%B0%D1%8F_%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u041f\u0435\u0440\u0432\u0430\u044f \u043c\u0438\u0440\u043e\u0432\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u041f\u0435\u0440\u0432\u043e\u0439 \u043c\u0438\u0440\u043e\u0432\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a>, \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0430\u044f \u0441\u0443\u0431\u043c\u0430\u0440\u0438\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=E-3_(%D0%BF%D0%BE%D0%B4%D0%B2%D0%BE%D0%B4%D0%BD%D0%B0%D1%8F_%D0%BB%D0%BE%D0%B4%D0%BA%D0%B0,_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F,_1911)&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"E-3 (\u043f\u043e\u0434\u0432\u043e\u0434\u043d\u0430\u044f \u043b\u043e\u0434\u043a\u0430, \u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f, 1911) (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">E-3<\/a> \u0437\u0430\u0442\u043e\u043d\u0443\u043b\u0430 \u043f\u043e\u0441\u043b\u0435 \u043f\u043e\u043f\u0430\u0434\u0430\u043d\u0438\u044f \u0442\u043e\u0440\u043f\u0435\u0434\u044b, \u0432\u044b\u043f\u0443\u0449\u0435\u043d\u043d\u043e\u0439 \u0441 \u043d\u0435\u043c\u0435\u0446\u043a\u043e\u0439 \u043b\u043e\u0434\u043a\u0438 <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=U-27_(%D0%BF%D0%BE%D0%B4%D0%B2%D0%BE%D0%B4%D0%BD%D0%B0%D1%8F_%D0%BB%D0%BE%D0%B4%D0%BA%D0%B0,_%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F,_1913)&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"U-27 (\u043f\u043e\u0434\u0432\u043e\u0434\u043d\u0430\u044f \u043b\u043e\u0434\u043a\u0430, \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f, 1913) (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">U-27<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4\" title=\"1919 \u0433\u043e\u0434\">1919<\/a>&#160;\u2014 \u043f\u0440\u0438\u0431\u044b\u0432\u0448\u0438\u0439 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041f\u0435\u0442\u0440\u043e\u0433\u0440\u0430\u0434<\/a> \u043f\u0440\u0435\u0434\u0441\u0435\u0434\u0430\u0442\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D0%BE%D0%BD%D0%BD%D1%8B%D0%B9_%D0%B2%D0%BE%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D1%81%D0%BE%D0%B2%D0%B5%D1%82\" title=\"\u0420\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u043e\u043d\u043d\u044b\u0439 \u0432\u043e\u0435\u043d\u043d\u044b\u0439 \u0441\u043e\u0432\u0435\u0442\">\u0420\u0435\u0432\u0432\u043e\u0435\u043d\u0441\u043e\u0432\u0435\u0442\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%BE%D1%86%D0%BA%D0%B8%D0%B9,_%D0%9B%D0%B5%D0%B2_%D0%94%D0%B0%D0%B2%D0%B8%D0%B4%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0422\u0440\u043e\u0446\u043a\u0438\u0439, \u041b\u0435\u0432 \u0414\u0430\u0432\u0438\u0434\u043e\u0432\u0438\u0447\">\u041b\u0435\u0432 \u0414\u0430\u0432\u0438\u0434\u043e\u0432\u0438\u0447 \u0422\u0440\u043e\u0446\u043a\u0438\u0439<\/a> \u0438\u0437\u0434\u0430\u043b \u043f\u0440\u0438\u043a\u0430\u0437 \u043e\u0431\u043e\u0440\u043e\u043d\u044f\u044e\u0449\u0435\u0439 \u0433\u043e\u0440\u043e\u0434 7-\u0439 \u0430\u0440\u043c\u0438\u0438: \u00ab\u041d\u0435 \u043f\u0438\u0441\u0430\u0442\u044c \u043b\u043e\u0436\u043d\u044b\u0445 \u0441\u0432\u0435\u0434\u0435\u043d\u0438\u0439 \u043e \u0436\u0435\u0441\u0442\u043e\u043a\u0438\u0445 \u0431\u043e\u044f\u0445 \u0442\u0430\u043c, \u0433\u0434\u0435 \u0431\u044b\u043b\u0430 \u0436\u0435\u0441\u0442\u043e\u043a\u0430\u044f \u043f\u0430\u043d\u0438\u043a\u0430. \u0417\u0430 \u043d\u0435\u043f\u0440\u0430\u0432\u0434\u0443 \u043a\u0430\u0440\u0430\u0442\u044c, \u043a\u0430\u043a \u0437\u0430 \u0438\u0437\u043c\u0435\u043d\u0443. \u0412\u043e\u0435\u043d\u043d\u043e\u0435 \u0434\u0435\u043b\u043e \u0434\u043e\u043f\u0443\u0441\u043a\u0430\u0435\u0442 \u043e\u0448\u0438\u0431\u043a\u0438, \u043d\u043e \u043d\u0435 \u043b\u043e\u0436\u044c, \u043e\u0431\u043c\u0430\u043d \u0438 \u0441\u0430\u043c\u043e\u043e\u0431\u043c\u0430\u043d\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1920_%D0%B3%D0%BE%D0%B4\" title=\"1920 \u0433\u043e\u0434\">1920<\/a>&#160;\u2014 \u0441 18 \u043f\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/21_%D0%BE%D0%BA%D1%82%D1%8F%D0%B1%D1%80%D1%8F\" title=\"21 \u043e\u043a\u0442\u044f\u0431\u0440\u044f\">21 \u043e\u043a\u0442\u044f\u0431\u0440\u044f<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0435<\/a> \u0432 \u043f\u043e\u043c\u0435\u0449\u0435\u043d\u0438\u0438 \u0414\u043e\u043c\u0430 \u043f\u0435\u0447\u0430\u0442\u0438 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0441\u044f I \u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u0439 \u0441\u044a\u0435\u0437\u0434 \u043f\u0440\u043e\u043b\u0435\u0442\u0430\u0440\u0441\u043a\u0438\u0445 \u043f\u0438\u0441\u0430\u0442\u0435\u043b\u0435\u0439, \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u043e\u043c \u043f\u0440\u0438\u0441\u0443\u0442\u0441\u0442\u0432\u043e\u0432\u0430\u043b\u043e 142 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430. \u0421\u043e\u0431\u0440\u0430\u0432\u0448\u0438\u0435\u0441\u044f \u0438\u0437\u0431\u0440\u0430\u043b\u0438 \u043f\u043e\u0447\u0451\u0442\u043d\u044b\u043c\u0438 \u043f\u0440\u0435\u0434\u0441\u0435\u0434\u0430\u0442\u0435\u043b\u044f\u043c\u0438 \u0441\u044a\u0435\u0437\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%BD%D0%B8%D0%BD,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%98%D0%BB%D1%8C%D0%B8%D1%87\" title=\"\u041b\u0435\u043d\u0438\u043d, \u0412\u043b\u0430\u0434\u0438\u043c\u0438\u0440 \u0418\u043b\u044c\u0438\u0447\">\u0412.&#160;\u0418.&#160;\u041b\u0435\u043d\u0438\u043d\u0430<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D1%83%D0%BD%D0%B0%D1%87%D0%B0%D1%80%D1%81%D0%BA%D0%B8%D0%B9,_%D0%90%D0%BD%D0%B0%D1%82%D0%BE%D0%BB%D0%B8%D0%B9_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D1%8C%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041b\u0443\u043d\u0430\u0447\u0430\u0440\u0441\u043a\u0438\u0439, \u0410\u043d\u0430\u0442\u043e\u043b\u0438\u0439 \u0412\u0430\u0441\u0438\u043b\u044c\u0435\u0432\u0438\u0447\">\u0410.&#160;\u0412.&#160;\u041b\u0443\u043d\u0430\u0447\u0430\u0440\u0441\u043a\u043e\u0433\u043e<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%BA%D1%81%D0%B8%D0%BC_%D0%93%D0%BE%D1%80%D1%8C%D0%BA%D0%B8%D0%B9\" title=\"\u041c\u0430\u043a\u0441\u0438\u043c \u0413\u043e\u0440\u044c\u043a\u0438\u0439\">\u041c. \u0413\u043e\u0440\u044c\u043a\u043e\u0433\u043e<\/a>. \u041d\u0430 \u0441\u044a\u0435\u0437\u0434\u0435 \u0431\u044b\u043b \u043f\u0440\u0438\u043d\u044f\u0442 \u0443\u0441\u0442\u0430\u0432 \u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0433\u043e \u0441\u043e\u044e\u0437\u0430 \u043f\u0440\u043e\u043b\u0435\u0442\u0430\u0440\u0441\u043a\u0438\u0445 \u043f\u0438\u0441\u0430\u0442\u0435\u043b\u0435\u0439 \u0438 \u043f\u043e\u043b\u043e\u0436\u0435\u043d\u043e \u043d\u0430\u0447\u0430\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%81%D0%B5%D1%80%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B0%D1%81%D1%81%D0%BE%D1%86%D0%B8%D0%B0%D1%86%D0%B8%D1%8F_%D0%BF%D1%80%D0%BE%D0%BB%D0%B5%D1%82%D0%B0%D1%80%D1%81%D0%BA%D0%B8%D1%85_%D0%BF%D0%B8%D1%81%D0%B0%D1%82%D0%B5%D0%BB%D0%B5%D0%B9\" title=\"\u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0430\u0441\u0441\u043e\u0446\u0438\u0430\u0446\u0438\u044f \u043f\u0440\u043e\u043b\u0435\u0442\u0430\u0440\u0441\u043a\u0438\u0445 \u043f\u0438\u0441\u0430\u0442\u0435\u043b\u0435\u0439\">\u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0430\u0441\u0441\u043e\u0446\u0438\u0430\u0446\u0438\u0438 \u043f\u0440\u043e\u043b\u0435\u0442\u0430\u0440\u0441\u043a\u0438\u0445 \u043f\u0438\u0441\u0430\u0442\u0435\u043b\u0435\u0439<\/a> (\u0412\u0410\u041f\u041f). \u0418\u043c\u0435\u043d\u0430 \u0443\u0447\u0430\u0441\u0442\u043d\u0438\u043a\u043e\u0432 \u0441\u044a\u0435\u0437\u0434\u0430 (\u0412. \u041a\u0438\u0440\u0438\u043b\u043b\u043e\u0432, \u041c. \u0413\u0435\u0440\u0430\u0441\u0438\u043c\u043e\u0432, \u0410. \u041c\u0430\u0448\u0438\u0440\u043e\u0432-\u0421\u0430\u043c\u043e\u0431\u044b\u0442\u043d\u0438\u043a \u0438 \u0434\u0440.), \u043f\u0440\u0430\u0432\u0434\u0430, \u043d\u0438\u0447\u0435\u0433\u043e \u043d\u0435 \u0433\u043e\u0432\u043e\u0440\u044f\u0442 \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u043c\u0443 \u0447\u0438\u0442\u0430\u0442\u0435\u043b\u044e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1921_%D0%B3%D0%BE%D0%B4\" title=\"1921 \u0433\u043e\u0434\">1921<\/a>&#160;\u2014 \u0438\u0437\u0434\u0430\u043d \u0434\u0435\u043a\u0440\u0435\u0442 \u043e\u0431 \u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0438\u0438 \u041a\u0440\u044b\u043c\u0441\u043a\u043e\u0439 \u0430\u0432\u0442\u043e\u043d\u043e\u043c\u0438\u0438 \u0432 \u0441\u043e\u0441\u0442\u0430\u0432\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0420\u043e\u0441\u0441\u0438\u0438<\/a>. \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1945_%D0%B3%D0%BE%D0%B4\" title=\"1945 \u0433\u043e\u0434\">1945 \u0433\u043e\u0434\u0443<\/a> \u0430\u0432\u0442\u043e\u043d\u043e\u043c\u0438\u044f \u0431\u044b\u043b\u0430 \u043f\u0440\u0435\u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0430 \u0432 \u041a\u0440\u044b\u043c\u0441\u043a\u0443\u044e \u043e\u0431\u043b\u0430\u0441\u0442\u044c, \u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1954_%D0%B3%D0%BE%D0%B4\" title=\"1954 \u0433\u043e\u0434\">1954 \u0433\u043e\u0434\u0443<\/a> \u043f\u0435\u0440\u0435\u0434\u0430\u043d\u0430 \u0432 \u0441\u043e\u0441\u0442\u0430\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D0%B0\" title=\"\u0423\u043a\u0440\u0430\u0438\u043d\u0430\">\u0423\u043a\u0440\u0430\u0438\u043d\u044b<\/a>. \u0410\u0432\u0442\u043e\u043d\u043e\u043c\u0438\u044f \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0430 \u0432 1991 \u0433\u043e\u0434\u0443<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1922_%D0%B3%D0%BE%D0%B4\" title=\"1922 \u0433\u043e\u0434\">1922<\/a>&#160;\u2014 \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0430 \u0431\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0430\u044f \u0440\u0430\u0434\u0438\u043e\u0432\u0435\u0449\u0430\u0442\u0435\u043b\u044c\u043d\u0430\u044f \u043a\u043e\u0440\u043f\u043e\u0440\u0430\u0446\u0438\u044f \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8-%D0%B1%D0%B8-%D1%81%D0%B8\" title=\"\u0411\u0438-\u0431\u0438-\u0441\u0438\">BBC<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1924_%D0%B3%D0%BE%D0%B4\" title=\"1924 \u0433\u043e\u0434\">1924<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D0%B2%D0%B5%D1%82_%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D1%8B%D1%85_%D0%BA%D0%BE%D0%BC%D0%B8%D1%81%D1%81%D0%B0%D1%80%D0%BE%D0%B2_%D0%A1%D0%A1%D0%A1%D0%A0\" title=\"\u0421\u043e\u0432\u0435\u0442 \u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0445 \u043a\u043e\u043c\u0438\u0441\u0441\u0430\u0440\u043e\u0432 \u0421\u0421\u0421\u0420\">\u0421\u043e\u0432\u043d\u0430\u0440\u043a\u043e\u043c<\/a> \u043f\u0440\u0438\u043d\u044f\u043b \u0434\u0435\u043a\u0440\u0435\u0442 \u043e\u0431 \u043e\u0431\u044f\u0437\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0445 \u043f\u0440\u0438\u0432\u0438\u0432\u043a\u0430\u0445 \u043f\u0440\u043e\u0442\u0438\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%82%D1%83%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%BE%D1%81%D0%BF%D0%B0\" title=\"\u041d\u0430\u0442\u0443\u0440\u0430\u043b\u044c\u043d\u0430\u044f \u043e\u0441\u043f\u0430\">\u043e\u0441\u043f\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1929_%D0%B3%D0%BE%D0%B4\" title=\"1929 \u0433\u043e\u0434\">1929<\/a><ul><li>\u041f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u0441\u043a\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BC%D0%BE%D0%BB%D1%91%D1%82\" title=\"\u0421\u0430\u043c\u043e\u043b\u0451\u0442\">\u0441\u0430\u043c\u043e\u043b\u0451\u0442\u0430<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A-5_(%D1%81%D0%B0%D0%BC%D0%BE%D0%BB%D1%91%D1%82)\" title=\"\u041a-5 (\u0441\u0430\u043c\u043e\u043b\u0451\u0442)\">\u041a-5<\/a>\u00bb <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BB%D0%B8%D0%BD%D0%B8%D0%BD,_%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041a\u0430\u043b\u0438\u043d\u0438\u043d, \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d \u0410\u043b\u0435\u043a\u0441\u0435\u0435\u0432\u0438\u0447\">\u041a.&#160;\u0410.&#160;\u041a\u0430\u043b\u0438\u043d\u0438\u043d\u0430<\/a>. \u00ab\u041a-5\u00bb \u0441\u0442\u0430\u043b \u043f\u0435\u0440\u0432\u044b\u043c \u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u043c \u043f\u0430\u0441\u0441\u0430\u0436\u0438\u0440\u0441\u043a\u0438\u043c \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u043e\u043c, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0441\u0442\u0440\u043e\u0438\u043b\u0441\u044f \u0431\u043e\u043b\u044c\u0448\u043e\u0439 \u0441\u0435\u0440\u0438\u0435\u0439. \u041e\u0441\u043d\u043e\u0432\u043d\u043e\u0439 \u0441\u0430\u043c\u043e\u043b\u0451\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%8D%D1%80%D0%BE%D1%84%D0%BB%D0%BE%D1%82\" title=\"\u0410\u044d\u0440\u043e\u0444\u043b\u043e\u0442\">\u0410\u044d\u0440\u043e\u0444\u043b\u043e\u0442\u0430<\/a> \u0434\u043e 1940 \u0433\u043e\u0434\u0430. \u0412\u0441\u0435\u0433\u043e \u0431\u044b\u043b\u043e \u043f\u043e\u0441\u0442\u0440\u043e\u0435\u043d\u043e 258 \u0441\u0430\u043c\u043e\u043b\u0451\u0442\u043e\u0432 \u044d\u0442\u043e\u0433\u043e \u0442\u0438\u043f\u0430.<\/li><li>\u0411\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u0438\u0439 \u0427\u0430\u0441\u0442\u043d\u044b\u0439 \u0421\u043e\u0432\u0435\u0442 \u043f\u0440\u0438\u0437\u043d\u0430\u043b \u043a\u0430\u043d\u0430\u0434\u0441\u043a\u0438\u0445 \u0436\u0435\u043d\u0449\u0438\u043d \u00ab\u043f\u0435\u0440\u0441\u043e\u043d\u0430\u043c\u0438\u00bb, \u043e\u0442\u043c\u0435\u043d\u0438\u0432 \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u043a\u0430\u043d\u0430\u0434\u0441\u043a\u043e\u0433\u043e \u0412\u0435\u0440\u0445\u043e\u0432\u043d\u043e\u0433\u043e \u0421\u0443\u0434\u0430, \u0437\u0430\u043f\u0440\u0435\u0442\u0438\u0432\u0448\u0435\u0433\u043e \u0436\u0435\u043d\u0449\u0438\u043d\u0430\u043c \u0437\u0430\u043d\u0438\u043c\u0430\u0442\u044c \u043f\u0443\u0431\u043b\u0438\u0447\u043d\u044b\u0435 \u0434\u043e\u043b\u0436\u043d\u043e\u0441\u0442\u0438.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1941_%D0%B3%D0%BE%D0%B4\" title=\"1941 \u0433\u043e\u0434\">1941<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%BE%D0%BA%D0%B8%D0%BE\" title=\"\u0422\u043e\u043a\u0438\u043e\">\u0422\u043e\u043a\u0438\u043e<\/a> \u0430\u0440\u0435\u0441\u0442\u043e\u0432\u0430\u043d \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0439 \u0440\u0430\u0437\u0432\u0435\u0434\u0447\u0438\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%BE%D1%80%D0%B3%D0%B5,_%D0%A0%D0%B8%D1%85%D0%B0%D1%80%D0%B4\" title=\"\u0417\u043e\u0440\u0433\u0435, \u0420\u0438\u0445\u0430\u0440\u0434\">\u0420\u0438\u0445\u0430\u0440\u0434 \u0417\u043e\u0440\u0433\u0435<\/a> (Richard Sorge).<\/li><li><a href=\"h